import React ,{Component} from "react";


class ConCard extends Component  {
  render (){
    return (
        <div className="col-5 bg-dark text-white m-1 p-3 rounded border">
          <img src={prop.img} />
          <h3>{prop.name}</h3>
          <h6>phone {prop.phone}</h6>
          <h6 style={{ color: prop.email ? "white" : "red" }}>
            {prop.email ? "emile" + prop.email : "no found email"}
          </h6>
        </div>
      );
  }
  }

export default ConCard
